import React from 'react';
//import FormEssay from './forms/FormEssay.js';
//import Reservation from './forms/FormReservation.js';
import SignUpDialog from './utils/SignUpDialog.js';
import Footer from './site/Footer.js';
import Header from './Header.js';
import Home from './components/Home.js';
//import Calculator from './components/Calculator.js';
////import BowlBuilder from './components/BowlBuilder.js';
import SurfLog from './components/Logger.js';
import './css/App.css';

const company = "KFA";
const path = window.location.pathname;
const componentId = path.replace('/','').toLocaleLowerCase();
const currentComponent = componentId;
const components = {
  surflog: <SurfLog />,
  guestlist: <SignUpDialog title="Guest List" message="Sign up"/>,
  //reservation: <Reservation />,
  //essay: <FormEssay className='mt-40'/>,
  //tempconverter: <Calculator />,
  //bowlbuilder: <BowlBuilder />,
  home: <Home />
};
const componentTag = (current) => <div className="App">
                                    <Header company={company}/>
                                    {components[current]}
                                    <Footer />
                                  </div>;

const App = () => componentTag(currentComponent);

export default App;
